Importance of tight feet in the sand❗️ People often talk about how “smooth” my riding style is and how I rarely get out of shape, but the truth is my bike is constantly moving around underneath me like in this video. Keeping your feet tight to the frame helps the rear end snap straight after kicking out sideways and allows you to correct your bike with your lower body, while your upper body can remain still and relaxed. Maybe people just watch my upper body/helmet when I ride which is why I appear so smooth? Sending your weight through your feet (rather than your butt) also drastically increases your rear-wheel traction and allows you to increase forward momentum which plays a HUGE part in correcting your bike and keeping it straight. If I let off the gas at all when my bike kicked sideways heading up to the face of this jump, I probably would have been laid out😂 it takes some balls to commit wide-open in a scenario like that, but ironically it’s normally the only thing that will save you

Okay, that’s my rant for the night✌🏼

