Physical exam with my orthopedic surgeon showed that the Labrum in my shoulder is most likely torn and will require surgery this Fall, so that’s a bummer…going in for an MRI to confirm later this week🫤 The good news is that he said I should be good to finish out the season with it torn as long as the pain isn’t too bad, so we’ll see you savages this weekend at @thewick338mx !

Probably could have picked a better round to go into with a shoulder injury, but we’ll be tuckin’ elbow and slingin’ sand regardless. Let’s get it ladies n gents🫡 📸@ferrickmoto

