Flying lap from qualifying at Southwick on my trusty @insta360 X3 camera! This lap was good enough for p-18 in the 450 A group which I was stoked on. Really happy with my speed at the last 2 rounds, but I can’t deny how big of a problem my shoulder is. Tasks as simple as putting my shirt on are almost impossible today. Not ideal, but we push onward! 

You guys may notice I’ve been back on the @renthal_moto 827 fatbar for the last 2 races. I felt my overall center of gravity has been too high on the new chassis, so I switched over to some 10mm lower @rtitanium foot pegs and paired it with the 827 bend which is roughly 10mm lower than the 997 I’ve been running. As a result, the distance between my hands and feet stayed the same while my entire setup dropped 10mm. I feel like that’s helped me MASSIVELY with balancing in long ruts and cornering in general. The qualifying times seem to back it up as well😜 Excited to head to Millville next weekend, and then get a long 4 week break to let this shoulder heal🤙🏼

