Speed has been great the last 3 weekends, but it’s been a struggle to make it through these motos with my shoulder. I’ve never been much of a “raw speed” guy, so qualifying 18th, 22nd, and 20th at the last three races has been huge for me! Hopefully I can convert that into some top 20 moto finishes after my shoulder heals during this break.

Results have been frustrating, but at least I know I’m not slow! 4 weeks to fix things up and finish the last 3 rounds strong💪🏼 📸@701.media

