Ready for Unadilla!! Custom @skda.moto graphics kit turned out awesome for our title sponsor @themotocrossnetwork and secondary sponsor @cmarini14 🔥🔥 Massive thank you to the awesome people who step up every weekend to help us go racing.

Unfortunately my MRI result this week showed 2 tears to the labrum in my left shoulder, along with some other less serious ligament damage and some “looseness” in the front of my ball/socket joint. I honestly was not expecting it to be as bad as it is, but that’s motocross for ya🤷🏼‍♀️ Surgery is scheduled for right after the final round at Ironman. Not quite ideal, but we’ll give her hell for the next 3 races and enjoy a couple months of “vacation” while this thing heals up💪🏼 for now, let’s go play in some mud!

